import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'app-frontend';
}
<mat-card id="main">
  <mat-card-title [ngStyle]="{ 'text-align': 'center' }">
    <h2>Todo list!</h2>
  </mat-card-title>
  <mat-card-content>
    <form></form>
  </mat-card-content>
</mat-card>
